textOriginal:
Sou cearense, moro em Boa Vista/Roraima. Como espectadora assídua do programa considero relevante destacar os seguintes pontos:
1. Penso que, por questão de profissionalismo, é recomendável que todos os participantes do programa se cumprimentem. Trata-se de postura deselegante e constrangedora expor um colega de bancada a condição de invisibilidade;
2. DS, continuadamente, apresenta atitudes extremamente provocativas. Constata-se, por vezes, smj, a intenção velada de ofender, até menosprezar a capacidade intelectiva dos participantes e exaltar sua superioridade ética; 
3. Talvez não tenha sido o propósito de AN, mas seria perfeitamente compreensível e admissível reação a injusta, dissimulada e contumaz provocação. 
4. Por fim, queremos apenas notícias. Congratulo e agradeço a todos que participam do programa a frente e atrás das câmeras.
5. Obrigada 👏🏻👏🏻 B🇧🇷22

